                    g_x_xxyyy[k] = pbx * g10_0_xxyyy[k] + fr * g11_0_xxyyy[k] + 2.0 * f2t * gk_0_xyyy[k];

                    g_x_xxyyz[k] = pbx * g10_0_xxyyz[k] + fr * g11_0_xxyyz[k] + 2.0 * f2t * gk_0_xyyz[k];

                    g_x_xxyzz[k] = pbx * g10_0_xxyzz[k] + fr * g11_0_xxyzz[k] + 2.0 * f2t * gk_0_xyzz[k];

                    g_x_xxzzz[k] = pbx * g10_0_xxzzz[k] + fr * g11_0_xxzzz[k] + 2.0 * f2t * gk_0_xzzz[k];

                    g_x_xyyyy[k] = pbx * g10_0_xyyyy[k] + fr * g11_0_xyyyy[k] + f2t * gk_0_yyyy[k];

                    g_x_xyyyz[k] = pbx * g10_0_xyyyz[k] + fr * g11_0_xyyyz[k] + f2t * gk_0_yyyz[k];

                    g_x_xyyzz[k] = pbx * g10_0_xyyzz[k] + fr * g11_0_xyyzz[k] + f2t * gk_0_yyzz[k];

                    g_x_xyzzz[k] = pbx * g10_0_xyzzz[k] + fr * g11_0_xyzzz[k] + f2t * gk_0_yzzz[k];

                    g_x_xzzzz[k] = pbx * g10_0_xzzzz[k] + fr * g11_0_xzzzz[k] + f2t * gk_0_zzzz[k];

                    g_x_yyyyy[k] = pbx * g10_0_yyyyy[k] + fr * g11_0_yyyyy[k];

                    g_x_yyyyz[k] = pbx * g10_0_yyyyz[k] + fr * g11_0_yyyyz[k];

                    g_x_yyyzz[k] = pbx * g10_0_yyyzz[k] + fr * g11_0_yyyzz[k];

                    g_x_yyzzz[k] = pbx * g10_0_yyzzz[k] + fr * g11_0_yyzzz[k];

                    g_x_yzzzz[k] = pbx * g10_0_yzzzz[k] + fr * g11_0_yzzzz[k];

                    g_x_zzzzz[k] = pbx * g10_0_zzzzz[k] + fr * g11_0_zzzzz[k];

                    // leading y component

                    fr = wpy[k];

                    g_y_xxxxx[k] = pby * g10_0_xxxxx[k] + fr * g11_0_xxxxx[k];

                    g_y_xxxxy[k] = pby * g10_0_xxxxy[k] + fr * g11_0_xxxxy[k] + f2t * gk_0_xxxx[k];

                    g_y_xxxxz[k] = pby * g10_0_xxxxz[k] + fr * g11_0_xxxxz[k];

                    g_y_xxxyy[k] = pby * g10_0_xxxyy[k] + fr * g11_0_xxxyy[k] + 2.0 * f2t * gk_0_xxxy[k];

                    g_y_xxxyz[k] = pby * g10_0_xxxyz[k] + fr * g11_0_xxxyz[k] + f2t * gk_0_xxxz[k];

                    g_y_xxxzz[k] = pby * g10_0_xxxzz[k] + fr * g11_0_xxxzz[k];

                    g_y_xxyyy[k] = pby * g10_0_xxyyy[k] + fr * g11_0_xxyyy[k] + 3.0 * f2t * gk_0_xxyy[k];

                    g_y_xxyyz[k] = pby * g10_0_xxyyz[k] + fr * g11_0_xxyyz[k] + 2.0 * f2t * gk_0_xxyz[k];

                    g_y_xxyzz[k] = pby * g10_0_xxyzz[k] + fr * g11_0_xxyzz[k] + f2t * gk_0_xxzz[k];

