                    g_zzzz_yyzzz[k] = pbz * g10_zzz_yyzzz[k] + fr * g11_zzz_yyzzz[k] + f2g * (3.0 * g20_zz_yyzzz[k] - 3.0 * fgz * g21_zz_yyzzz[k]) + 3.0 * f2t * gk_zzz_yyzz[k];

