                    g_zzzz_zzzzz[k] = pbz * g10_zzz_zzzzz[k] + fr * g11_zzz_zzzzz[k] + f2g * (3.0 * g20_zz_zzzzz[k] - 3.0 * fgz * g21_zz_zzzzz[k]) + 5.0 * f2t * gk_zzz_zzzz[k];
